import React from 'react'

function PDFList({ pdfs, setSelectedPdf }) {
  return (
    <div className="pdf-list">
      {pdfs.map((pdf) => (
        <div
          key={pdf.id}
          className="pdf-item"
          onClick={() => setSelectedPdf(pdf)}
        >
          <img src={pdf.thumbnail} alt={pdf.title} className="pdf-thumbnail" />
          <div className="pdf-info">
            <h3>{pdf.title}</h3>
            <p>{pdf.author}</p>
          </div>
        </div>
      ))}
    </div>
  );
}

export default PDFList;
